import React from 'react'

const Hello = () => {
  
  /*
  With JSX
    return (
        <div>
            <h1>Hello Hilian</h1>
        </div>
    )
    */
        //  Without JSX
    return React.createElement('div',null,'<h1>Hello Ariel</h1>')
}

export default Hello;
